
function text(key){
	return result.get(key).split("<li>").join("")
	  .split("</li>").join("").split("<ul>").join("")
	  .split("</ul>").join("").split("<h4>").join("")
	  .split("</h4>").join("").split("<br>").join("")
	  .split("<strong>").join("").split("</strong>").join("");
}
